import React from 'react';

const App: React.FC = () => {
  return (
    <div style={{ padding: "10px" }}>
      <h1>SyncWatch</h1>
      <button onClick={() => alert("Start Sync!")}>Start Sync</button>
    </div>
  );
};

export default App;
